import styled from 'styled-components';

export const Paginator = styled.div`
  background-color: transparent;
`

export const Button = styled.button`
  padding: 8px 16px;
  height: 64px;
  width: 64px;
  font-weight: 1000;
  background-color: transparent;
  color: white;
  transition: background-color 300ms;

  &:hover {
    background-color: #222
  }
`
